import React from "react";
import Card from "../Card"; // Adjust the import path based on your project structure
import "../../App.css";
import "../Explore.css";

export default function Explore() {
  const cardData = [
    {
      type: "Student",
      profilePicture: "../../../images/profile-icon.jpg",
      name: "John Doe",
      researchInterests: "Machine Learning",
      educationLevel: "Ph.D.",
    },
    {
      type: "Advisor",
      profilePicture: "../../../images/profile-icon.jpg",
      name: "Jane Smith",
      researchInterests: "Artificial Intelligence",
      educationLevel: "Professor",
    },
    {
      type: "Student",
      profilePicture: "../../../images/profile-icon.jpg",
      name: "Alice Johnson",
      researchInterests: "Data Science",
      educationLevel: "Master's",
    },
    {
      type: "Student",
      profilePicture: "../../../images/profile-icon.jpg",
      name: "Jamie Wise",
      researchInterests: "Machine Learning",
      educationLevel: "Bachelor's",
    },
    {
      type: "Student",
      profilePicture: "../../../images/profile-icon.jpg",
      name: "Jamie Wise",
      researchInterests: "Machine Learning",
      educationLevel: "Bachelor's",
    },
  ];

  return (
    <div className="explore">
      <h1>EXPLORE</h1>
      <div className="card-container">
        {cardData.map((card, index) => (
          <Card key={index} {...card} />
        ))}
      </div>
    </div>
  );
}
